import React, { useState, useEffect } from 'react'
// import { ReactComponent as ArrowLeft } from '../assets/arrow-left.svg'
import { Link } from 'react-router-dom'

const Application = ({ match, history }) => {

    let applicationId = match.params.id
    let [application, setApplication] = useState(null)

    useEffect(() => {
        getApplication()
    }, [applicationId])


    let getApplication = async () => {
        if (applicationId === 'new') return

        let response = await fetch(`http://127.0.0.1:8000/api/applications/${applicationId}/`)
        let data = await response.json()
        setApplication(data)
    }






    return (
        <div className="note" >

              <p>{application}</p>
        </div>
    )
}

export default Application
